import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.div`
  width: 100%;
  height: 75px;
  background-color: #1363A8;
`

const Header = () => {
  return (
    <HeaderContainer>
    </HeaderContainer>
  );
}

export default Header;
